import { Helmet, Grid, makeStyles, Container, Typography } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    padding: theme.spacing(10),
  },
}));



function Home() {
  const classes = useStyles();


  return (
    <Container maxWidth="sm" className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={12}>

          <Typography variant="h5" gutterBottom>

           <div>
             <h1 style={{color: "red"}}>Hello world</h1>
             </div>



  <p>Нет страшнее зверя в сибирских лесах, чем разъяренный заяц-мутант.  
  Вы видели, какие у него зубы? О, даже медведь боится этих зубов! А, как известно, 
  медведи больше ничего не боятся.</p>
          </Typography>
          <Typography variant="body1" gutterBottom>
            This is demo app with login, registration and updating profile
            flows.
          </Typography>

        </Grid>
      </Grid>
    </Container>
  );
}

export default Home;
